import React from 'react';
import {UilSearch} from '@iconscout/react-unicons';         


const Home = () => {
  return (
   <div className="Home">
       <h1 className='sneak_in'> <a href="/home"> SNEAK IN </a> </h1>
        <div className="Search">
            <input type="text" placeholder='Explore' />
                <span className="s-icon">
                  <UilSearch/>
                </span>
            </div>
   </div>
  )
}

export default Home;
